import React, { Component } from 'react'
import YouTubeComponent from '../../components/YouTube-Component/YouTubeComponent'

class Home extends Component {
   render() {
      return (
         <div>
            <p>YouTube Component</p>
            <hr/>
            <YouTubeComponent time='9.13' title='My video 1' desc='Tutorial React Part-1'/>
            <YouTubeComponent time='12.5' title='My video 2' desc='Tutorial React Part-2'/>
            <YouTubeComponent time='8.04' title='My video 3' desc='Tutorial React Part-3'/>
            <YouTubeComponent time='15.23' title='My video 4' desc='Tutorial React Part-4'/>
            <YouTubeComponent /> 
         </div>
      )
   }
}

export default Home
